Here is an example of an Autotune class in C++:
```
#include <iostream>
#include <cmath>

class Autotune {
public:
    // Constructor
    Autotune(float threshold = 0.5, float speed = 10.0) :
        threshold_(threshold), speed_(speed) {}

    // Process a single audio sample
    float processSample(float sample) {
        // Calculate the distance from the center frequency (0)
        float distance = std::abs(sample);

        // Check if the distance is above the threshold
        if (distance > threshold_) {
            // If it's above the threshold, pitch shift the sample
            return pitchShift(sample, distance);
        } else {
            // If it's below the threshold, return the original sample
            return sample;
        }
    }

    // Pitch shift the sample
    float pitchShift(float sample, float distance) {
        // Calculate the new frequency based on the speed and distance
        float newFrequency = sample + (distance * speed_ / 100.0);

        // Return the new sample with the adjusted frequency
        return newFrequency;
    }

private:
    float threshold_; // Threshold above which to apply pitch shifting
    float speed_;     // Speed of the pitch shifting (higher values = more extreme shifts)
};

int main() {
    Autotune autotune(0.7, 20.0); // Create an Autotune object with custom threshold and speed

    // Generate some random audio samples
    float samples[10] = {1.0, -2.3, 0.5, -1.8, 3.1, -0.2, 2.6, -1.1, 0.9, -3.4};

    // Process each sample through the Autotune object
    for (int i = 0; i < 10; i++) {
        samples[i] = autotune.processSample(samples[i]);
    }

    // Print the processed samples
    for (int i = 0; i < 10; i++) {
        std::cout << "Processed Sample " << i << ": " << samples[i] << std::endl;
    }

    return 0;
}
```
