In C, you can use the `printf` function with the `.2` format specifier to round a `double` value to two decimal places when printing it.

Here's an example:
```c
#include <stdio.h>

int main() {
    double num = 12.3456;
    printf("%.2f", num);  // prints "12.35"
    return 0;
}
```
If you want to round the value itself (not just for printing), you can use the `round` function from the `math.h` library:

```c
#include <math.h>

int main() {
    double num = 12.3456;
    num = round(num * 100.0) / 100.0;  // rounds to two decimal places
    printf("%.2f", num);  // prints "12.35"
    return 0;
}
```
Alternatively, you can use the `ceil`, `floor`, or `trunc` functions from the same library, depending on your specific rounding needs.

For instance, if you want to always round up or down, you can use:
```c
num = ceil(num * 100.0) / 100.0;  // always round up
num = floor(num * 100.0) / 100.0;  // always round down
num = trunc(num * 100.0) / 100.0;  // truncate (round towards zero)
